#!/usr/bin/env python3
import sys


def f(n):
    '''
    >>> f(105)
    8
    '''
    ret = 0
    for i in range(1, n+1):
        if n % i == 0:
            ret += 1
    return ret

def solve(N: int):
    ret = 0
    for i in range(1, N+1):
        if i % 2 == 1 and f(i) == 8:
            ret += 1
    return ret

# Generated by 1.1.6 https://github.com/kyuridenamida/atcoder-tools
def main():
    def iterate_tokens():
        for line in sys.stdin:
            for word in line.split():
                yield word
    tokens = iterate_tokens()
    N = int(next(tokens))  # type: int
    print(solve(N))

def test():
    import doctest
    doctest.testmod()

if __name__ == '__main__':
    test()
    main()
